namespace RonSijm.FluidHumidifier.Factories.Connect;

public class InstanceStorageConfigFactory(string resourceName = null, Action<Humidifier.Connect.InstanceStorageConfig> factoryAction = null) : ResourceFactory<Humidifier.Connect.InstanceStorageConfig>(resourceName)
{

    internal InnerInstanceStorageConfigKinesisStreamConfigFactory KinesisStreamConfigFactory { get; set; }

    internal InnerInstanceStorageConfigS3ConfigFactory S3ConfigFactory { get; set; }

    internal InnerInstanceStorageConfigKinesisVideoStreamConfigFactory KinesisVideoStreamConfigFactory { get; set; }

    internal InnerInstanceStorageConfigKinesisFirehoseConfigFactory KinesisFirehoseConfigFactory { get; set; }

    protected override Humidifier.Connect.InstanceStorageConfig Create()
    {
        var instanceStorageConfigResult = CreateInstanceStorageConfig();
        factoryAction?.Invoke(instanceStorageConfigResult);

        return instanceStorageConfigResult;
    }

    private Humidifier.Connect.InstanceStorageConfig CreateInstanceStorageConfig()
    {
        var instanceStorageConfigResult = new Humidifier.Connect.InstanceStorageConfig
        {
            GivenName = InputResourceName,
        };

        return instanceStorageConfigResult;
    }
    public override void CreateChildren(Humidifier.Connect.InstanceStorageConfig result)
    {
        base.CreateChildren(result);

        result.KinesisStreamConfig ??= KinesisStreamConfigFactory?.Build();
        result.S3Config ??= S3ConfigFactory?.Build();
        result.KinesisVideoStreamConfig ??= KinesisVideoStreamConfigFactory?.Build();
        result.KinesisFirehoseConfig ??= KinesisFirehoseConfigFactory?.Build();
    }

} // End Of Class

